css style sheet "style.css": I could not attach it to the submission, so here is the code: 

.slider .axis .axis-tick-mark, .slider .axis .axis-minor-tick-mark {
    -fx-fill: null;
    -fx-stroke-width: 2;
    -fx-stroke: linear-gradient(to right, #FF3333, #FFFF33, #33FF33);
}
.button, .toggle-button {
    -fx-font: bold italic 11pt "Arial";
    -fx-background-color: linear-gradient(to right, #3333FF, #FF33FF, #FF3333);
}

.button:pressed, .toggle-button:selected {
    -fx-font: bold italic 11pt "Arial";
    -fx-background-color: linear-gradient(to left, #FFFF33, #FF9933, #FF3333);
}

.slider .axis {
	-fx-tick-label-font-size: 11pt;
	-fx-tick-label-fill: linear-gradient(to right, #3333FF, #FF33FF, #FF3333);
}
.slider .track {
	-fx-background-color: linear-gradient(to right, #FF3333, #FFFF33, #33FF33);
}
.slider .thumb {
	-fx-background-color: linear-gradient(to right, #3333FF, #FF33FF, #FF3333);
	-fx-border-color: black;
	-fx-border-radius: 10;
	-fx-border-width: 1;
}
.slider .thumb:pressed {
	-fx-background-color: linear-gradient(to left, #FFFF33, #FF9933, #FF3333);
	-fx-border-color: #FFFFAA;
	-fx-border-radius: 10;
	-fx-border-width: 1;
}
#generation {
	-fx-text-fill: #AAAAFF;
	-fx-font: bold italic 15pt "Arial";
}
#file {
	-fx-font-size: 12pt;
}
#open, #save {
	-fx-font-size: 10pt;
}
#speed, #size {
	-fx-text-fill: #AAAAFF;
	-fx-font: bold italic 11pt "Arial";
}
